(119, 4, 6, 'SAMSUNG EVO Plus 64 GB MicroSDXC Class 10 95 MB/s  Memory Card', 'SAMSUNG', 9000, 10000, '<ul role=\"region\" aria-label=\"carousel\" style=\"margin-bottom: 0px; margin-left: 0px; list-style: outside none; color: rgb(77, 81, 86); font-family: Roboto, &quot;helvetica neue&quot;, helvetica, arial, sans-serif;\"><li class=\"va-top mb-8 fz-m\" role=\"group\" aria-label=\"Item 1 of 1\" style=\"margin: 0px 0px 8px; padding: 0px; font-size: 16px; line-height: 1.25; vertical-align: top; overflow: auto;\"><div class=\" lh-22 d-b \" style=\"margin: 0px; padding: 0px; line-height: 22px;\">Messaging and data rates may apply. With stunning speed and reliability, the Samsung 64GB microSDXC EVO Plus memory card lets you get the most out of your devices. Ultra-fast read &amp; write speeds of up to&nbsp;100MB/s &amp; 20MB/s&nbsp;and backed by 4-proof protection, keep your data safe against water, extreme temperatures, and other harsh conditions.</div></li></ul>', '5539.png', '5539.png', '5539.png', 0, 'In Stock', '2023-06-15 19:08:00', NULL),
(120, 4, 6, 'Lexar Professional 800x 32 SDHC Class 10 120 MB/s  Memory Card', 'Lexar', 8000, 10000, '<ul role=\"region\" aria-label=\"carousel\" style=\"margin-bottom: 0px; margin-left: 0px; list-style: outside none; color: rgb(77, 81, 86); font-family: Roboto, &quot;helvetica neue&quot;, helvetica, arial, sans-serif;\"><li class=\"va-top mb-8 fz-m\" role=\"group\" aria-label=\"Item 1 of 1\" style=\"margin: 0px 0px 8px; padding: 0px; font-size: 16px; line-height: 1.25; vertical-align: top; overflow: auto;\"><div class=\" lh-22 d-b \" style=\"margin: 0px; padding: 0px; line-height: 22px;\">More... Designed for point-and-shoot cameras, mid-range DSLR cameras, and HD camcorders, the 32GB High-Performance&nbsp;800x&nbsp;UHS-I&nbsp;SDHC Memory Card&nbsp;(BLUE Series) from&nbsp;Lexar&nbsp;features a storage capacity of 32GB and takes advantage of the UHS-I bus to let you quickly capture and transfer Full HD video, as well as raw and JPEG captures.</div></li></ul>', '5540.png', '5540.png', '5540.png', 0, 'In Stock', '2023-06-15 19:09:48', NULL),
(121, 3, 15, 'The haunting', 'ABC', 990, 1000, '<ul style=\"box-sizing: border-box; margin-bottom: 0px; margin-left: 0px; list-style: none; color: rgb(102, 102, 102); font-family: Roboto, sans-serif;\"><li style=\"box-sizing: border-box;\"><span style=\"color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: 14px;\">The dead do not rest till they get what they want. You have arrived in the hills. In here, you are surrounded by dense, menacing forests, enveloped in a deadly silence... You never know what lurks here in the Cold, dark night. Do not walk alone after sunset in the hills. A beautiful woman in white haunts the Lonely pathways, looking to enchant and ensnare men... All the people who died in accidents here... They say you hear their screams at night. And the deserted lodges sitting amidst lush greenery and calm streams... Spirits lie in wait here, ready to prey on the living. There are sceptics who did not heed these warnings. They tried to rationalize what they saw, what they felt. But when they came face to face with the beings that they believed didnt exist, they couldnt run away anymore... Ghosts of the silent hills is a collection that will make your nights a little scarier, encompassing the very best spine-chilling stories based on true hauntings.</span><br></li></ul>', '1.png', '1.png', '1.png', 0, 'In Stock', '2023-06-18 07:53:03', NULL),
